import React from 'react';

const Zip = (props) => {
    return (
        <div className="input-holder">
            <input type="text"
                value={props.zip}
                onChange={props.handleChange}
                name="zip"
                placeholder="Must be a 5 Digit Number"
                />
        </div>
    )
}
